Every top-level piece of code in SimpleScript will be a Statement. This will allow us to interpret declarations, definitions and also simpler expressions such as function calls. We'll represent this as an enum in Rust, since we'll have multiple types of Statement and Rust doesn't have an object-oriented model for inheritance. Rust's enum types are also unique as they allow you to created "tagged unions". If you've programmed in other low-level languages such as C, you've likely come across the union keyword before. Rust allows you to define variants on an enum that contain and hold their own pieces of data. That can either be in the form of struct-like variant or a tuple. For more information about Rust's "tagged unions", I recommend reading this excellent article by Tony Arcieri . For clarity and readability, we'll be using the struct form for our variants. Let's start by creating the enum and adding a variant to store the data for our LetStatement from a previous chapter. #[derive(Debug)]
pub enum Statement { Let { name: String, }
} The Debug derive-macro will be added to the majority of data types in SimpleScript. It will allow us to debug any problems we encounter in the future. The Statement enumeration now has a single Let variant. This variant is able to store a String, accessible as name. Of course, our Let statements won't just be storing the name of the identifier. We'll also need to store the default value for the variable too.

