With the Expression enumeration in place, we can add a new value field to Statement::Let that will provide the default value for the variable. #[derive(Debug)]
pub enum Statement { Let { name: String, value: Expression, }
} If you look back at a previous chapter, you'll remember that our flowchart didn't always expect an initial value for a variable. If the parser doesn't find a = token after the identifier, it just ends the statement. Most dynamic languages will initialise the value of this variable to null or nil. This is exactly what SimpleScript will do. However there are 2 ways to do this: Store an Expression::Null variant inside of value. Make value an Option instead. Since it's more idiomatic and "correct", we'll opt for an Option type. If an initial value isn't found by our parser, we can set the value = None instead of a ::Null expression. # #[derive(Debug)]
#pub enum Statement { Let { name: String, value: Option<Expression>, }
#}

